/**
 * Script to add user to WP Intranet
 */
answer = ifScript();

function ifScript() {
  workflow.scratchpad.wp_create_response = "";

  // Check if user exists
  var r = new sn_ws.RESTMessageV2('x_58872_needit.Check If WP Intranet User Exists', 'Check If WP Intranet User Exists - POST');
  r.setStringParameter("username", current.user_name);
  var response = r.execute();
  var responseBody = response.getBody();
  var httpStatus = response.getStatusCode();

  if (JSON.parse(responseBody) === "User Exists") {
    gs.info("WP Intranet User already exists for - " + current.user_name);
    return "yes";
  } else {
    // Create WP Intranet Account
    var r2 = new sn_ws.RESTMessageV2('x_58872_needit.Create WP Intranet User', 'Create WP Intranet User - POST');

    r2.setStringParameter("username", current.user_name);
    r2.setStringParameter("password", "Welcome!!");
    r2.setStringParameter("email", current.user_name);
    r2.setStringParameter("first_name", current.first_name);
    r2.setStringParameter("last_name", current.last_name);
    /** token set in rest message */

    var response2 = r2.execute();
    var responseBody2 = response2.getBody();
    var httpStatus2 = response2.getStatusCode();

    if (httpStatus2 === 200 && JSON.parse(responseBody2) !== "Invalid") {
      gs.info(
        "WP Intranet User created successfully for - " +
          current.user_name +
          "\n\nResponse - " +
          responseBody2
      );
      return "yes";
    } else {
      workflow.scratchpad.wp_create_response = responseBody2;
      gs.info("WP Intranet User NOT Created. \nResponse: " + responseBody2);
      return "no";
    }
  }
}

